import React from "react";
import { Grid } from "@material-ui/core";



const AddModal :  React.FC<{}> = () => {

    return (
        <div >

      <Grid container spacing={2}>
        <Grid item xs={12}>
          imagen
        </Grid>
        <Grid item xs={4}>
          nombre
        </Grid>
        <Grid item xs={4}>
          combo1
        </Grid>
        <Grid item xs={4}>
          combo 2
        </Grid>
        </Grid>
        </div>
    );


}

export default AddModal;
